import React from "react";
import "./Gallary.css";
import images from "../static/dummyData";

const Gallary = () => {
  return (
    <div className="Gallary">
      <div className="container">
        <img src="" alt="Selected" className="selected" />
        <div className="imgContainer">
          <img src="" alt="Dog" />
        </div>
      </div>
    </div>
  );
};

export default Gallary;
